import { Link } from 'react-router-dom'

function NavBar (){
    return(
        <nav>
            <Link to="/">
                <img src="./.public/logo192.png" alt="" />
            </Link>
            <Link to="/contact">Contact</Link>
        </nav>
    );
};

export default NavBar;
